import time

import numpy as np


class ReachDestination(Exception):
    def __init__(self, arg):
        self.args = arg


class BStar:
    def __init__(self, graph, start, end):
        self.graph = graph
        self.dist = np.zeros(self.graph.shape)
        self.start = start
        self.end = end
        self.d = np.array([[0, 1], [1, 0]])
        self.active = [self.start]
        self.nextActive = []
        self.step = 0
        self.path = self.end

    def up(self, pos):
        return pos - self.d[1, :]

    def down(self, pos):
        return pos + self.d[1, :]

    def left(self, pos):
        return pos - self.d[0, :]

    def right(self, pos):
        return pos + self.d[0, :]

    def direction(self, pos):
        dire = self.end - pos
        if dire[0] >= abs(dire[1]):
            return self.down(pos)
        elif dire[1] >= abs(dire[0]):
            return self.right(pos)
        elif dire[0] <= -abs(dire[1]):
            return self.up(pos)
        else:
            return self.left(pos)

    def branchSearch(self, pos, ob):
        if ob[0] != 0:
            lef = self.left(pos)
            rig = self.right(pos)
            li = self.graph[lef[0], lef[1]] == 0
            r = self.graph[rig[0], rig[1]] == 0
            if not li and not r:
                back = pos - ob
                if self.graph[back[0], back[1]] == 0:
                    self.nextActive.append(back)
                    self.graph[back[0], back[1]] = 2
                    self.dist[back[0], back[1]] = self.step
                return
            if li:
                self.nextActive.append(lef)
                self.graph[lef[0], lef[1]] = 2
                self.dist[lef[0], lef[1]] = self.step
            if r:
                self.nextActive.append(rig)
                self.graph[rig[0], rig[1]] = 2
                self.dist[rig[0], rig[1]] = self.step

        else:
            dow = self.down(pos)
            up = self.up(pos)
            d = self.graph[dow[0], dow[1]]
            u = self.graph[up[0], up[1]]
            if not d and not u:
                back = pos - ob
                if self.graph[back[0], back[1]] == 0:
                    self.nextActive.append(back)
                    self.graph[back[0], back[1]] = 2
                    self.dist[back[0], back[1]] = self.step
                return
            if d:
                self.nextActive.append(dow)
                self.graph[dow[0], dow[1]] = 2
                self.dist[dow[0], dow[1]] = self.step
            if u:
                self.nextActive.append(up)
                self.graph[up[0], up[1]] = 2
                self.dist[up[0], up[1]] = self.step

    def findNext(self, pos):
        nex = self.direction(pos)
        if nex[0] == self.end[0] and nex[1] == self.end[1]:
            self.dist[nex[0], nex[1]] = self.step
            raise ReachDestination('reach')
        if self.graph[nex[0], nex[1]] == 0:
            self.graph[nex[0], nex[1]] = 2
            self.dist[nex[0], nex[1]] = self.step
            self.nextActive.append(nex)
        else:
            self.branchSearch(pos, nex - pos)

    def bStar(self):
        self.step = 0
        self.graph[self.start[0], self.start[1]] = 2
        try:
            while self.active:
                self.step += 1
                for p in self.active:
                    self.findNext(p)
                self.active = self.nextActive.copy()
                self.nextActive.clear()
        except ReachDestination:
            return self.findPath()
        print("can't access")
        return []

    def findPath(self):
        path = self.end
        now = self.end
        step = self.dist[now[0], now[1]]
        while step != 1:
            if self.dist[now[0] + 1, now[1]] == step - 1:
                now = self.down(now)
                path = np.vstack((now, path))
            elif self.dist[now[0] - 1, now[1]] == step - 1:
                now = self.up(now)
                path = np.vstack((now, path))
            elif self.dist[now[0], now[1] + 1] == step - 1:
                now = self.right(now)
                path = np.vstack((now, path))
            elif self.dist[now[0], now[1] - 1] == step - 1:
                now = self.left(now)
                path = np.vstack((now, path))
            step -= 1
        path = np.vstack((self.start, path))
        self.path = path


